const sendToJumbotron = (object) => {
  let message = '';
  if (typeof object === 'undefined') {
    message = 'Jumbotron received something undefined, nothing to show!';
  }
  else if (object.toString() === '[object Response]') {
    message = `Jumbotron received a Response object. 
    Response objects do not *have* data, but they *stream* data. 
    You can request that data by calling a method that retrieves the data
    such as .json() or .text().
    @see https://developer.mozilla.org/en-US/docs/Web/API/Response#methods`;
  } else if (object.toString() === '[object Promise]') {
    message = `
    Jumbotron received a Promise. 
    It doesn't want the *Promise*. 
    It wants what the promise agreed to deliver.
    You must chain a .then() to the promise to get the delivery.`;
  } else {
    message = JSON.stringify(object, null, 2);
  }
  document.querySelector('#jumbotron .output').innerHTML = message;
}

